Please note that this is a Blu-ray formatted disc. This disc can only be played on a Blu-ray compatible PC, Blu-ray player, or a Playstation 3 of any model.Elle is a character who is a call girl with issues in her past. Through a series of sexual experiences she is able to find and accept herself, and discover the possibilities of personal freedom. She is young, somewhat naive, and she has done wrong. She is romanced by materialism, and a type of lifestyle, but deep down something isn't right about the way she feels about herself. This manifests itself in her sexual emotions, and her dynamics, and this enables her to experience and come to terms with her deeper feelings of guilt and a lack of self worth. The story is intended to be a visually poetic and sexually powerful journey towards acquiring the freedom she has been searching for by being honest with herself, taking responsibility, and making amends.
